//import Fab from '@material-ui/core/Fab'
import React from 'react'
import '../style/index.css'

const Header = () => {
  const style = {
    display: 'flex',
    flexDirection: 'row',
    alignItems: 'strech',
    justifyContent: 'space-between',
    paddingTop: '15px',
    paddingBottom: '10px',
    backgroundColor: 'rgb(218, 212, 212)',
  }
  const serachBoxStyle = {
    flex: 2,
    flexBasis: '70%',
  }
  const logoStyle = {
    flex: 1,
  }
  const searchButtonStyle = {
    flex: 1,
  }
  return (
    <div>
      <div style={style}>
        <div style={logoStyle}>Logo</div>

        <div>
          <input style={serachBoxStyle} type='text' size='40' />
        </div>
        <div style={searchButtonStyle}>
          <button>Search</button>
        </div>
      </div>
    </div>
  )
}

export default Header
